import React, { createElement } from 'react'
import { storiesOf } from '@storybook/react'
import { HeadMenu } from 'common-components'
import notes from './notes.md'

const stories = storiesOf('HeadMenu', module)

stories.add(
  'default',
  () =>
    createElement(() => {
      return (
        <>
          <HeadMenu />
        </>
      )
    }),
  { notes: { markdown: notes } }
)
